import React from "react";

function BotItem(name, health, damage, armour, catchphrase) {
    return (
        <div className="col-4 p-1">
            <div className="card h-100">
                <div className="card-body">
                    <h3>{name}</h3>
                    <p>{catchphrase}</p>
                    <div>
                        {health}
                        {damage}
                        {armour}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default BotItem
